import './App.css';
import React, { useEffect, useState } from 'react';

export default function App() {
  const [count, setCount] = useState(0);
  useEffect(
    () => {
      console.log("count changed: " + count)
    }, [count]
  )
  return (
    <div>
      <button onClick={() => setCount(count - 1)}>-</button>
      {count}
      <button onClick={() => setCount(count + 1)}>+</button>
    </div>
  );
}
